import React from 'react';
import "bootstrap/dist/css/bootstrap.min.css"
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import './App.css';

import Navbar from "./components/navbar.component";
import CreateAttendance from "./components/create-attendance.component";
import EditStudentAttendance from "./components/edit-student-attendance.component";
import CheckStudentAttendance from "./components/check-student-attendance.component";

function App() {
  return (
    <Router>
        <Navbar />
        <br/>
        <Routes>
        <Route path="/" exact element={CreateAttendance} />
        <Route path="/user" element={EditStudentAttendance} />
        <Route path="/help" element={CheckStudentAttendance} />
        </Routes>
    </Router>
  );
}

export default App;
